var tipuesearch = {"pages": [{'title': 'About', 'text': '\n 個人網站: https://40923102.github.io/cd2022/content/index.html \n 個人倉儲 : https://40923102.github.io/cd2022/ \n \n 小組網站: https://40923102.github.io/cd2022ag2-2/ \n 小組倉儲: https://github.com/40923102/cd2022ag2-2 \n \n 大組網站: https://40923102.github.io/cd2022ag2/ \n 大組倉儲: https://github.com/40923102/cd2022ag2 \n \n \n cmsimde_site \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Blog', 'text': '\n 網站網址: https://40923102.github.io/cd2022/blog/index.html \n \n', 'tags': '', 'url': 'Blog.html'}, {'title': 'w10', 'text': '\n 在影片中加入註解說明後,  分別以 \n (1) w10_block_ui 、 (2)w10_nx_integ  、 (3) w10_ssh  作為標題 ,  將說明影片嵌入個人  cd2022  網站頁面   及  blog  網誌中 . \n \xa0 \n w10-1  任務執行步驟 : \n > 下載  w10_block_ui.wnk \n > 利用  Wink  開啟專案 \n > 在各頁面加入說明標註 \n > 若有其他附加頁面 ,  則需縮至  1008x630  後插入適當位置 \n > 完成後轉出對應的  mp4  放入頁面與網誌 \n run_journal: 若以  NXOpen Python API  為例 ,  可以安排將  AJAX  送進  Server  的設計變數存為檔案 ,  然後由  run_journal.exe  執行的  Python  程式讀進設計變數後 ,  驅動  NX12 、 NX1980  或  NX2008  後將結果透過  URL  傳回前端瀏覽器端 . \n \xa0 \n', 'tags': '', 'url': 'w10.html'}, {'title': 'w10_block_ui', 'text': '\n \n \n \n \n', 'tags': '', 'url': 'w10_block_ui.html'}, {'title': 'w10_nx_integ', 'text': '\n \n \n \n \n', 'tags': '', 'url': 'w10_nx_integ.html'}, {'title': 'w10_ssh', 'text': '\n \n \n \n \n \n', 'tags': '', 'url': 'w10_ssh.html'}, {'title': '小組', 'text': '第二組 \n \n 組長: 40923105 吳芷萱 \n 組員: \n 40923102 王悅禎 \n 40923104 江宜珊 \n 40923106 巫翊婕 \n 40923107 李宛諭 \n 40923110 林芳羽 \n 40923121 沈諒祖 \n 40923153 陳仲凱 \n \n', 'tags': '', 'url': '小組.html'}, {'title': 'ag2-1', 'text': '\n 組長: 40923105 吳芷萱 \n 組員: \n 40923104 江宜珊 \n 40923106 巫翊婕 \n 40923121 沈諒祖 \n \n', 'tags': '', 'url': 'ag2-1.html'}, {'title': 'ag2-2', 'text': '組長: 40923 107 李宛諭 \n 組員: \n 40923102 王悅禎 \n 40923110 林芳羽 \n 40923153 陳仲凱 \n \n', 'tags': '', 'url': 'ag2-2.html'}, {'title': '分組名單', 'text': '第2組: repo: \xa0 40923102 \xa0 www: \xa0 40923102 \xa0 cd2022ag2-repo: \xa0 40923102 \xa0 cd2022ag2-www: \xa0 40923102 repo: \xa0 40923104 \xa0 www: \xa0 40923104 \xa0 cd2022ag2-repo: \xa0 40923104 \xa0 cd2022ag2-www: \xa0 40923104 repo: \xa0 40923105 \xa0 www: \xa0 40923105 \xa0 cd2022ag2-repo: \xa0 40923105 \xa0 cd2022ag2-www: \xa0 40923105 repo: \xa0 40923106 \xa0 www: \xa0 40923106 \xa0 cd2022ag2-repo: \xa0 40923106 \xa0 cd2022ag2-www: \xa0 40923106 repo: \xa0 40923107 \xa0 www: \xa0 40923107 \xa0 cd2022ag2-repo: \xa0 40923107 \xa0 cd2022ag2-www: \xa0 40923107 repo: \xa0 40923110 \xa0 www: \xa0 40923110 \xa0 cd2022ag2-repo: \xa0 40923110 \xa0 cd2022ag2-www: \xa0 40923110 repo: \xa0 40923121 \xa0 www: \xa0 40923121 \xa0 cd2022ag2-repo: \xa0 40923121 \xa0 cd2022ag2-www: \xa0 40923121 repo: \xa0 40923153 \xa0 www: \xa0 40923153 \xa0 cd2022ag2-repo: \xa0 40923153 \xa0 cd2022ag2-www: \xa0 40923153 \n \n', 'tags': '', 'url': '分組名單.html'}, {'title': '期末考週', 'text': '', 'tags': '', 'url': '期末考週.html'}, {'title': '題目 1', 'text': '請各學員利用\xa0 \n https://github.com/mdecycu/cd2022_guide/tree/main/downloads/w8_midterm/w8_uarm_nx12/uarm_robot_nx12 \xa0 目錄中的 uArm 機械手臂零件, 修改 "nx12絞鍊"與 "front joint" 零件的外型, 使能將 "Triangular connecting rod", "left link" 與 "end link" 等零組件, 與 "right crank" 與 "right link" 的組件左右互換. 各學員完成新 uArm 機械手臂組合檔案後, 請將零組件檔案放入個人 cd2022 倉儲 downloads 中的 w18/uarm 目錄後執行 acp, 並以 "完成期末考週 uarm 新組立檔案" 作為提交訊息. \n \n 使用NX版本: NX12 \n 心得: \n \n 原本是想要使用鏡射改圖，但是會刪到本體，再來想要一筆一畫描圖時，小組長教我可以直接在延伸改方向。 \n front joint是直接改變延伸方向就可以了，nx12絞鍊需要量測尺寸在基準面上做尺寸的變動，多次嘗試後終於成功了 \n 用的最久的是組合圖軸線以及貼面，約束過後不斷衝突、移位，後面發現失敗又往前重新修正，但是每次完成過後都會有一種成就感。 \n', 'tags': '', 'url': '題目 1.html'}, {'title': '繪製零件', 'text': '1.nx12絞鍊 \n \n \n \n \n \n \n \n 2.front joint \n \n \n \n \n', 'tags': '', 'url': '繪製零件.html'}, {'title': '組合', 'text': '\n 1.第一次組合 \n \n \n \n \n \n 2.修正 \n \n \n \n \n \n \n', 'tags': '', 'url': '組合.html'}, {'title': '每周進度', 'text': '\n 期中考:W9 繪圖 \n \n 期末: \n W16:練習 \n W17:測試及自評 \n W18:測試及自評 \n \n', 'tags': '', 'url': '每周進度.html'}, {'title': 'W1', 'text': '\n CADLab中的IPv6網路設定 https://mde.tw/wcm2022/content/index.html \xa0 (參考) 下載檔案 \n 由於許多免費軟體可能藏有病毒，如果做好網路措施則防範於未然 \n 【1】IPv6執行時 ， 需要 1_2022_cadlab_network_setup.reg 與 1_disable_ipv4.ps1 兩個檔案:  1_2022_cadlab_network_setup.reg \n 主要是關閉自動偵測 proxy ，  且手動設定代理主機. \n 【2】筆電則是利用IPv6投影到桌機上 使用遠端畫面(尚未成功) \n \n 協同產品設計實習承接電腦輔助設計實習課程, 著重在探討多人模式下 ，  如何有效執行與機電系統設計相關的產品開發流程  (人與人協同, 人與機器協同, 機器與機器協同) \n 分組 四人一小組，兩小組為一大組 \n 下載 NX1980 \n \n', 'tags': '', 'url': 'W1.html'}, {'title': 'W2', 'text': '\n (1)確認分組後，人數不足由老師那方做運算分配至每組八位成員 \n (2)建立小組倉儲並整合 \n \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '\n 利用 NX1980 繪製 uArm 機械手臂的協同設計 \n (1)  下載NX1980 \n \n (2) 每一學員分配 5 個影片 ， 根據影片中的教學內容 ， 以 Wink 影片互相對照的方式採 NX1980 執行操作進行整理 ， 完成後請將所負責的 Wink 教學影片嵌入個人與大分組的 w3 標題頁面中. \n \n \n \n 任務參考 \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '\n 小組與大組成員開會討論後，在上課時段中直接利用網頁簡報呈現W3結果. \n \n', 'tags': '', 'url': 'W4.html'}, {'title': 'W5', 'text': '', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '\n (1) 建立個人 Blog 並查驗 \n 使用Leo製作個人 Blog\xa0( 我的Blog \xa0) \n \xa0 \n > 在  cmd  輸入  leo  啟動  Leo Editor \n > 開啟檔案 (config 資料夾中的  pelican.leo) \n > 找到  @edit pelicanconf.py\xa0  變更網誌編輯者名稱及標題。 \n > 找到  @edit publishconf.py  中，將  SITEURL  改成自己網站中的  Blog  網址 \n > 編輯  pages  目錄中的  .md  檔案，改成自己網站的網址。 \n > 以 @edit 為檔名開頭，存為  .md  檔， Slug  更改為當週查驗的標題。 \n > 回到  cmd  ，然後推送至遠端 \n \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '\n (1)查驗網誌 \n (2) git clone \xa0 https://github.com/mdecourse/scarysim.git \n >修改 scarysim.pro, 蓋掉第 11 行, 成為 # LIBS\xa0\xa0\xa0\xa0 += -lglut -lGLU \n >cd scarysim \n >qmake -o Makefile scarysim.pro \n >mingw32-make -f Makefile.Release 可以在 release 目錄取得 scarysim.exe \n \n (3)繪製 Pick and Place demo 範例所需的零組件，並完成 Coppeliasim 4.1.0、4.2.0 與 4.3.0 版的 MTB 機械手臂 Pick and Place 模擬， 完成後請說明在使用不同 MCAD 系統與版次的情況下，該如何執行協同產品設計專案 \n \n 工作分配 \n Solvespace:\xa0 40923104 \n Onshape:\xa0 \xa0 \xa0 40923106 \n NX1980:\xa0 \xa0 \xa0\xa0 40923102 \n NX2008:\xa0 \xa0 \xa0  40923107 \n NX12:\xa0 \xa0 \xa0 \xa0 \xa0\xa0 40923110 \n \n 我繪製的檔案: \n 1. NX12、NX1980 \n 2.檔案連結: \n https://drive.google.com/drive/folders/1JDAeTbkdAOVRxUjLb1HObfLt78RIWofu?usp=sharing \n \n \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '\n (1)查驗網誌 \n 當日記事: leo 的內部建立節點檔名不需要重複輸入 html ，在資料夾內部已產生 html 檔案 \n (2) 工作分配 \n Onshape ： 40923104 、 40932106 \n NX1980 ： 40923102 、 40923110 \n Solvespace ： 40923105 、 40923107 \n 圖檔網址 https://drive.google.com/drive/folders/1X03fJgd8utmThPyCZ-ExgXPFgtHjj4yg?usp=sharing \n \n 負責部分截圖: \n \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '\n 期中考周 \n (1)自評成績 \n (2)自我檢測及個人作業 \n (3)自行補充前面課程 \n \n \n', 'tags': '', 'url': 'W9.html'}, {'title': 'W11', 'text': '\n 1.( 要寫心得 ) 以每兩人一小組的方式，在組長帳號下的分組倉儲中的同一網頁  ( 標題為  w11s1 ~w11s4)  加入個人  w8-w10  協同設計過程所負責的項目內容與心得 .  過程中請參考下列  Wink  影片解決可能產生的衝突，最後並將  git pull  至  acp  的操作過程，建立  Wink  影片後，以組員為單位嵌入個人負責的協同網頁中 . \n 2. 搜尋  STL  檔案中的  ASCII  與  Binary  格式，舉例說明這兩種零件檔案格式如何定義 ? \n 試著將 Link2  零件檔案轉入  Coppeliasim  後，分別以兩種  XML  格式轉出，並以  Leo Editor  導入後比較其內容差異 . CoppeliaSim  兩種  XML  格式中的  tags \n \xa0 \n 40923102 心得 ： \n W8 開始繪製 UARM ，我被分配到大一有學過的 NX12 ，雖然不太熟悉，但是有另一位同學協助我完成繪製，剩下的是由小組長及大組長幫忙完成的。 \n \n \n \n \n \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '\n 1.cd2022_uarm_nx12_imported.7z  中 ,  若計入重複引用的零件 ,  總數有多少 ?  請列出組成此一  2.uarm  機械手臂所需的  BOM  列表 . \n 3. 若不計入重複引用的零件 ,  總數有多少 ?  請列出各零件名稱 . \n 4. 當執行機械手臂的設計過程中 ,  若已知各零件所擬採用的零件材料密度 ,  請問此一設計中的  uarm  機械手臂的淨重量為多少 ? (uArm-Swift-Specifications.pdf) \n 5. 當執行機械手臂設計與製程規劃時 ,  若已知各零件擬採行的製造程序、取得方法與所需時間及成本 ,  請問此一設計中的  uarm  機械手臂 ,  該如何計算一定數量需求下 ,  需花費多少時間 ?  如何計算成本 ? \n \n \n \n \n \n \n \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'Online', 'text': '', 'tags': '', 'url': 'Online.html'}, {'title': 'W13', 'text': '\n (1) 在  CoppeliaSim 4.3.0  中解譯  Python scripts  設定 :C:\\CoppeliaSimEdu_4.3.0_ \n rev3\\system\\usrset.txt \n (2)Microsoft Teams 心得 \n 內容: 編輯 leo 做 Blog 及 NX 繪製 \n 心得: 學習到新的網站及不同的編輯方式 \n \xa0 \n', 'tags': '', 'url': 'W13.html'}, {'title': 'W14', 'text': '說明如何利用 CoppeliaSim 4.3.0 rev3  編寫  Python scripting,  以及如何因應各套件快速改版 .  說明如何利用  NX2027  開啟  MTB robot  範例 \n 以 MTB  機械手臂為例 ,  從  NX12  繪製零組件後轉入  CoppeliaSim 4.3.0  後 ,  如何利用  Lua Script  以鍵盤按鍵控制桿件移動 \n 說明 Teams  中指定作業的目的 .  示範如何利用動態網頁中的  Edit All  或  Edit  處理不同近端改版內容與遠端倉儲資料的衝突 .  最後示範如何在  Onedrive  環境中將上傳影片或檔案設為共享 \n \n 作業: \n 繳交Uram檔案: https://drive.google.com/drive/folders/1X03fJgd8utmThPyCZ-ExgXPFgtHjj4yg?usp=sharing \n \n', 'tags': '', 'url': 'W14.html'}, {'title': 'W15', 'text': '(1)因為系上的 NX 認證主機送修，所以目前的NX12不能使用 \n 所以 NX12更正成(下圖)就可以繼續使用了 \n \n \n (2)作業: NX + CoppeliaSim + Suction Pad - Pick and Place Scene Creation2 \n 參考 w7任務中的 MTB robot pick and place 場景,以N12繪製 MTB robot 零組件後 ， 匯入CoppeliaSim 4.3.0rev3 建立bject取放模擬場景 ， 完成後上傳 \n \n (3)uArm robot NX12  與  Coppeliasim  場景建立 \n \n 協同設計考量: \n (1) 採行方法是否具備永續性 ( 態度要積極 , 方法可能最佳化 ) 與韌性 ( 方法要能随環境調變 ) \n (2) 要有同理心 \n (3) 要能換位思考 \n (4) 要有產品生命週期的概念 \n (5) 要步步為營 \n (6) 不要過早下不必要的決定 \n \n', 'tags': '', 'url': 'W15.html'}, {'title': 'W16', 'text': '\n 從 Coppeliasim 4.3.0  置入  Visualization Stream  後 ,  機電模擬場景可從瀏覽器端進行控制的趨勢 \n', 'tags': '', 'url': 'W16.html'}, {'title': 'Online Exam', 'text': '1.已知左側綠色底座的 uArm 機械手臂, 其基座座標原點位於絕對座標 (1.0, 0.25, 0), 啟動模擬後 green_suctionpad_frame 座標原點則位於 (0.22859, 0.26047, 0.36576), 請列出運算式說明, 啟動模擬後 joint1, joint2 與 joint3 分別以逆時針旋轉 5 度後, 求 green_suctionpad_frame 的絕對座標值. 2.已知左側 uarm 前方的紅色方塊頂端中心座標值為 (0.2, 0.4, 0.1), 請列出運算式說明左側 uarm 機械手臂的 joint1, joint2 與 joint3 該如何旋轉才能讓 end effector 的吸盤末端中心點移動至紅色方塊頂端中心? \n', 'tags': '', 'url': 'Online Exam.html'}, {'title': 'Visualization Stream', 'text': 'CoppeliaSim 4.3.0 之前的版本, 並無 Visualization Stream 的功能, 因此在 mdecycu/airhockey (github.com) 專案中, 利用 OpenCV 結合 Flask 將模擬場景中的 Vision Sensor 影像串流至使用者的瀏覽器端, 並透過 Python Remote API 控制伺服器場景與實體機電系統中的制動元件, 以便達到虛實整合的目的. (1)在 uArm 場景伺服器端, 解開壓縮檔案後, 以 CoppeliaSim 4.3.0 rev3 開啟 uarm_nx_tkinter_gui_control.ttt 或 uarm_nx_tkinter_gui_control_exhaustive.simscene.xml. (2)啟動模擬之前, 從 Modules 下拉式表單中的 Connectivity 右方表單中, 點選 Visualization Stream, 表示要啟動場景的視覺串流伺服器. (3)確定 Visualization Stream 顯示 running 後, 啟動 uarm_nx_tkinter_gui_control 場景模擬. (4)從 simAddOnVisualization stream.lua 串流程式可知內定連線 port 為 23020 或可自行設定連線埠號, 並讓串流伺服器端的防火牆允許遠端特定的電腦 client 連線. (5)最後在 client 端以 SciTE 開啟 uarm_tkinter_control.py 配合修改串流伺服器對應的 IP 與埠號後執行. 便可透過瀏覽器檢視經由遠端 tkinter 介面控制下的 uArm 機械手臂各軸模擬運動. \n \n', 'tags': '', 'url': 'Visualization Stream.html'}, {'title': 'W17', 'text': '\n 課堂檢查W15 以及 W16 ，以及學期課程檔案 \n \n 6/19 日突發狀況 : 原本近端推送遠端都是正常的，於下午某一次推送時就無法開啟網站編輯不過多方嘗試後可以推送但無法編輯，於下午 7 、 8 點時，小組長使用自己的電腦幫我嘗試編輯， cms 點開後即可編輯，但是不明帳號已經是登入我的狀態但是還是是小組長本身的 github 帳號推送，初步猜測是因為在小組長的 TMP 底下。 \n 採取的措施:(1) 先是關閉批次檔不行後 (2) 電腦執行完整關機不行 (3) 重新至倉儲 clone 不行 (4) 檢查檔案 沒有發現遺漏 (5) 使用別的電腦 不行 (6) 至老師的 cmsimde_site 重新clone 不行 (7) 組長幫忙檢查檔案 無缺失 (8) 把檔案全部刪除並下載，經過確認後發現是批次檔的問題 \n', 'tags': '', 'url': 'W17.html'}]};